import $api from "../http";
import {AxiosResponse} from 'axios';
import { IUser } from "../models/IUser";

export default class AddService {
    static async add(description: string, value: string): Promise<AxiosResponse<IUser>> {
        return $api.post<IUser>('/add', {description, value});
    }
}
